import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsx mdx */
import withLayout from 'nextra-theme-docs'
import { withSSG } from 'nextra/ssg'
import layoutConfig from '/Users/halves/Developer/templates/jetpack-stack/docs/theme.config.js'

const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const MDXLayout = function NextraPage (props) {
    return withSSG(withLayout({
      filename: "anchors.md",
      route: "/docs/anchors",
      meta: {},
      pageMap: [{"name":"_app","route":"/_app"},{"name":"api","children":[{"name":"anchors","route":"/api/anchors"},{"name":"get-started","route":"/api/get-started"},{"name":"i18n","route":"/api/i18n"},{"name":"mdx","route":"/api/mdx"},{"name":"meta.json","meta":{"get-started":"Get Started","structure":"Structure","mdx":"Markdown and React","ssg":"SSG Support","anchors":"Anchor Links","i18n":"I18n"}},{"name":"ssg","route":"/api/ssg"},{"name":"structure","route":"/api/structure"}],"route":"/api"},{"name":"docs","children":[{"name":"anchors","route":"/docs/anchors"},{"name":"get-started","route":"/docs/get-started"},{"name":"i18n","route":"/docs/i18n"},{"name":"mdx","route":"/docs/mdx"},{"name":"meta.json","meta":{"get-started":"Get Started","structure":"Structure","mdx":"Markdown and React","ssg":"SSG Support","anchors":"Anchor Links","i18n":"I18n"}},{"name":"ssg","route":"/docs/ssg"},{"name":"structure","route":"/docs/structure"}],"route":"/docs"},{"name":"index","route":"/"},{"name":"meta.json","meta":{"index":"Jetpack","api":"Api","docs":"Docs"}}]
    }, layoutConfig))(props)
}
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...props} components={components} mdxType="MDXLayout">
    <h1>{`Anchor Links`}</h1>
    <p><inlineCode {...{
        "parentName": "p"
      }}>{`h2`}</inlineCode>
      {` tags will become anchors in the sidebar automatically.`}</p>
    <h2>{`When You Are Old`}</h2>
    <p>{`When you are old and grey and full of sleep,`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`And nodding by the fire, take down this book,`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`And slowly read, and dream of the soft look`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`Your eyes had once, and of their shadows deep;`}</p>
    <p>{`How many loved your moments of glad grace,`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`And loved your beauty with love false or true,`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`But one man loved the pilgrim soul in you,`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`And loved the sorrows of your changing face;`}</p>
    <p>{`And bending down beside the glowing bars,`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`Murmur, a little sadly, how Love fled`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`And paced upon the mountains overhead`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`And hid his face amid a crowd of stars.`}</p>
    <h2>{`The Young Man's Song`}</h2>
    <p>{`I whispered, "I am too young,"`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`And then, "I am old enough";`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`Wherefore I threw a penny`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`To find out if I might love.`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`"Go and love, go and love, young man,`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`If the lady be young and fair,"`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`Ah, penny, brown penny, brown penny,`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`I am looped in the loops of her hair.`}</p>
    <p>{`Oh, love is the crooked thing,`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`There is nobody wise enough`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`To find out all that is in it,`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`For he would be thinking of love`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`Till the stars had run away,`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`And the shadows eaten the moon.`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`Ah, penny, brown penny, brown penny,`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`One cannot begin it too soon.`}</p>
    <h2>{`The Sorrow of Love`}</h2>
    <p>{`The quarrel of the sparrows in the eaves,`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`The full round moon and the star-laden sky,`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`And the loud song of the ever-singing leaves,`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`Had hid away earth's old and weary cry.`}</p>
    <p>{`And then you came with those red mournful lips,`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`And with you came the whole of the world's tears,`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`And all the sorrows of her labouring ships,`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`And all the burden of her myriad years.`}</p>
    <p>{`And now the sparrows warring in the eaves,`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`The curd-pale moon, the white stars in the sky,`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`And the loud chaunting of the unquiet leaves`}
      <br {...{
        "parentName": "p"
      }} />
      {`
`}
      {`Are shaken with earth's old and weary cry.`}</p>

  </MDXLayout>;
}

